DROP TABLE IF EXISTS `SoundEmitters`; 
CREATE TABLE `SoundEmitters` ( `ID` INT NOT NULL DEFAULT '0', `PositionX` FLOAT NOT NULL DEFAULT '0', `PositionY` FLOAT NOT NULL DEFAULT '0', `PositionZ` FLOAT NOT NULL DEFAULT '0', `DirectionX` FLOAT NOT NULL DEFAULT '0', `DirectionY` FLOAT NOT NULL DEFAULT '0', `DirectionZ` FLOAT NOT NULL DEFAULT '0', `SoundEntriesID` INT NOT NULL DEFAULT '0', `MapID` INT NOT NULL DEFAULT '0', `Name` TEXT NULL, PRIMARY KEY (`ID`)) ENGINE=InnoDB DEFAULT CHARSET=utf8; 
